Este módulo gerencia o cadastro das entidades no sistema. Uma pessoa é a principal entidade utilizada para identificar funcionários, empresas, pessoas físicas. Este módulo começa implementando o cadastro das pessoas que interage com o sistema como: pessoas físicas, pessoas jurídicas. A maioria das tabelas não tem em sua chave primaria o auto-incremento e por isso ao inserir alguma informação na tabela, utiliza a tabela auxilitar cadastro.index . id id_pessoas id_pessoas_fisicas id_pessoas_juridicas id_clientes id_fabricantes id_fornecedores id_enderecos id_contatos 1 2 1 1 1 Comandos: -- object: cadastro.index | type: TABLE --
-- DROP TABLE IF EXISTS cadastro.index CASCADE;
CREATE TABLE cadastro.index (
id integer NOT NULL,
id_pessoas bigint DEFAULT 1,
id_pessoas_fisicas bigint DEFAULT 1,
id_pessoas_juridicas bigint DEFAULT 1,
id_clientes bigint DEFAULT 1,
id_fabricantes bigint DEFAULT 1,
id_fornecedores bigint DEFAULT 1,
id_enderecos bigint DEFAULT 1,
id_contatos bigint DEFAULT 1,
CONSTRAINT index_pkey PRIMARY KEY (id)
);
-- ddl-end --
ALTER TABLE cadastro.index OWNER TO administradores;
-- ddl-end -- Tanto um como o outro são identificados por um único ID. Tabela: cadastro.pessoas id nome 1 A.M.E. 2 Robson Comandos: SET check_function_bodies = false;
-- ddl-end -- -- object: cadastro | type: SCHEMA --
-- DROP SCHEMA IF EXISTS cadastro CASCADE;
CREATE SCHEMA cadastro;
-- ddl-end --
ALTER SCHEMA cadastro OWNER TO administradores;
-- ddl-end -- -- object: cadastro.pessoas | type: TABLE --
-- DROP TABLE IF EXISTS cadastro.pessoas CASCADE;
CREATE TABLE cadastro.pessoas (
id bigint NOT NULL,
nome text NOT NULL,
CONSTRAINT pessoas_pkey PRIMARY KEY (id)
);
-- ddl-end --
ALTER TABLE cadastro.pessoas OWNER TO administradores;
-- ddl-end -- A classificação destas pessoas é feita por outra tabela. Tabela: cadastro.pessoas_fisicas id id_pessoa sobrenome cpf rg data_emissao id_cidade_nascimento id_estado_nascimento id_pais_nascimento data_nascimento pai mae 1 2 Teodoro Calixto 33726070826 343532074 04/08/1986 0 0 0 04/08/1986 Edmo Teodoro da Silva Terezinha Calixto da Cruz Silva Comandos: -- object: cadastro.pessoas_fisicas | type: TABLE --
-- DROP TABLE IF EXISTS cadastro.pessoas_fisicas CASCADE;
CREATE TABLE cadastro.pessoas_fisicas ( id bigint NOT NULL, id_pessoa bigint NOT NULL, sobrenome text, cpf text NOT NULL, rg text NOT NULL, data_emissao date, id_cidade_nascimento integer, id_estado_nascimento integer, id_pais_nascimento integer, data_nascimento date, pai text, mae text, CONSTRAINT pessoas_fisicas_cpf_key UNIQUE (cpf), CONSTRAINT pessoas_fisicas_id_pessoa_key UNIQUE (id_pessoa), CONSTRAINT pessoas_fisicas_pkey PRIMARY KEY (id)
);
-- ddl-end --
ALTER TABLE cadastro.pessoas_fisicas OWNER TO administradores;
-- ddl-end -- Tabela: cadastro.pessoas_juridicas id id_pessoa razao_social cnpj ie data_fundacao 1 1 A.M.E. Automação de Maquinas e Equipamentos LTDA. 60579216000185 297005500110 01/01/1989 Comandos: -- object: cadastro.pessoas_juridicas | type: TABLE --
-- DROP TABLE IF EXISTS cadastro.pessoas_juridicas CASCADE;
CREATE TABLE cadastro.pessoas_juridicas ( id bigint NOT NULL, id_pessoa bigint NOT NULL, razao_social text, cnpj text NOT NULL, ie text, data_fundacao date, CONSTRAINT pessoas_juridicas_cnpj_key UNIQUE (cnpj), CONSTRAINT pessoas_juridicas_id_pessoa_key UNIQUE (id_pessoa), CONSTRAINT pessoas_juridicas_pkey PRIMARY KEY (id)
);
-- ddl-end --
ALTER TABLE cadastro.pessoas_juridicas OWNER TO administradores;
-- ddl-end -- A pessoa jurídica também é classificada por: fabricante, cliente, fornecedor. Tabela: cadastro.fabricantes id id_pessoa id_pessoa_juridica 1 1 1 Comandos: -- object: cadastro.fabricantes | type: TABLE --
-- DROP TABLE IF EXISTS cadastro.fabricantes CASCADE;
CREATE TABLE cadastro.fabricantes ( id bigint NOT NULL, id_pessoa bigint, id_pessoa_juridica bigint, CONSTRAINT fabricantes_id_pessoa_key UNIQUE (id_pessoa), CONSTRAINT fabricantes_pkey PRIMARY KEY (id)
);
-- ddl-end --
ALTER TABLE cadastro.fabricantes OWNER TO administradores;
-- ddl-end -- Tabela: cadastro.cliente id id_pessoa id_pessoa_juridica Comandos: -- object: cadastro.clientes | type: TABLE --
-- DROP TABLE IF EXISTS cadastro.clientes CASCADE;
CREATE TABLE cadastro.clientes ( id bigint NOT NULL, id_pessoa bigint, id_pessoa_juridica bigint, CONSTRAINT clientes_id_pessoa_key UNIQUE (id_pessoa), CONSTRAINT clientes_pkey PRIMARY KEY (id)
);
-- ddl-end --
ALTER TABLE cadastro.clientes OWNER TO administradores;
-- ddl-end -- Tabela: cadastro.tipos_fornecedores id descricao Comandos: -- object: cadastro.tipos_fornecedores | type: TABLE --
-- DROP TABLE IF EXISTS cadastro.tipos_fornecedores CASCADE;
CREATE TABLE cadastro.tipos_fornecedores ( id integer NOT NULL, descricao text NOT NULL, CONSTRAINT tipos_fornecedores_descricao_key UNIQUE (descricao), CONSTRAINT tipos_fornecedores_pkey PRIMARY KEY (id)
);
-- ddl-end --
ALTER TABLE cadastro.tipos_fornecedores OWNER TO administradores;
-- ddl-end -- Tabela: cadastro.fornecedores id id_pessoa id_pessoa_juridica id_tipo_fornecedor Comandos: -- object: cadastro.fornecedores | type: TABLE --
-- DROP TABLE IF EXISTS cadastro.fornecedores CASCADE;
CREATE TABLE cadastro.fornecedores ( id bigint NOT NULL, id_pessoa bigint, id_pessoa_juridica bigint, id_tipo_fornecedor integer DEFAULT 1, CONSTRAINT fornecedores_id_pessoa_key UNIQUE (id_pessoa), CONSTRAINT fornecedores_pkey PRIMARY KEY (id)
);
-- ddl-end --
ALTER TABLE cadastro.fornecedores OWNER TO administradores;
-- ddl-end --
